DROP PROCEDURE IF EXISTS [dbo].[Report_informe_sox]
GO
CREATE PROCEDURE [dbo].[Report_informe_sox] AS
	BEGIN
        IF (select value from sysroLiveAdvancedParameters where ParameterName like 'SecurityMode') = 2
            SELECT (select top 1 convert(nvarchar(500), value) from EmployeeUserFieldValues where fieldname = 'N.EMPLEADO' and EmployeeUserFieldValues.IDEmployee = e.ID order by Date desc ) as NEmpleado, sp.Name as Empleado, sgf.Name as Rol,
            (select top 1 convert(nvarchar(max), value) from EmployeeUserFieldValues where fieldname = 'CENTRO' and EmployeeUserFieldValues.IDEmployee = e.ID order by Date desc ) as Centro
            FROM   sysropassports sp 
                    LEFT JOIN employees e 
                            ON e.id = sp.idemployee  AND e.ID in (select distinct IDEmployee from EmployeeContracts where BeginDate <= GETDATE() and EndDate >= GETDATE() )
                    LEFT JOIN sysrosecuritynode_passports ssp 
                            ON sp.id = ssp.idpassport 
                    LEFT JOIN sysrogroupfeatures sgf 
                            ON sgf.id = ssp.idgroupfeature 
            WHERE sp.State <> 0 and sp.IsSupervisor = 1 
            ORDER BY sgf.Name asc, sp.Name asc
        ELSE
            SELECT (select top 1 convert(nvarchar(500), value) from EmployeeUserFieldValues where fieldname = 'N.EMPLEADO' and EmployeeUserFieldValues.IDEmployee = e.ID order by Date desc ) as NEmpleado, sp.Name as Empleado, sgf.Name as Rol,
            (select top 1 convert(nvarchar(max), value) from EmployeeUserFieldValues where fieldname = 'CENTRO' and EmployeeUserFieldValues.IDEmployee = e.ID order by Date desc ) as Centro
            FROM  sysropassports sp 
                    left JOIN employees e 
                            ON State <> 0 AND e.id = sp.idemployee AND e.ID in (select distinct IDEmployee from EmployeeContracts where BeginDate <= GETDATE() and EndDate >= GETDATE() )
                    LEFT JOIN sysrogroupfeatures sgf 
                            ON sgf.id = sp.idgroupfeature 
            WHERE  sp.IsSupervisor = 1 AND sp.State <> 0
            order by sgf.Name, sp.Name asc
    END
GO